import React from "react";
import { View, Text } from "react-native";

const PageB = () => {
  return (
    <View
      style={{
        flex: 1,
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "#fff",
      }}
    >
      <Text>This is page 2</Text>
    </View>
  );
};

export default PageB;
